import React from 'react';
import { Link } from 'react-router-dom';

const NavBar = () => (
  <nav>
    <Link to="/">Home</Link> | <Link to="/flights">Flights</Link> | <Link to="/my-bookings">My Bookings</Link> | <Link to="/login">Login</Link>
  </nav>
);

export default NavBar;
